schemaDefinition: "create or replace view X_SNC_IMPLMNTATION_IMPLEMENTATION(\n\t\"\
  ImplSysID\",\n\t\"ImplNumber\",\n\t\"ImplLineNumber\",\n\t\"ImplImplementationType\"\
  ,\n\t\"ImplGoLiveDate\",\n\t\"ImplAcctSysID\",\n\t\"ImplActive\",\n\t\"ImplBusinessUnit\"\
  ,\n\t\"ImplContractNumber\",\n\t\"ImplContractLine\",\n\t\"ImplSysCreatedOn\",\n\
  \t\"ImplProductPriceSysID\",\n\t\"ImplProductPrice\",\n\t\"ImplStage\",\n\t\"ImplSysUpdatedOn\"\
  \n) as -- SEMANTIC LAYER BEGINS\n\nSELECT \"SYS_ID\" as \"ImplSysID\",\n       \"\
  NUMBER\" as \"ImplNumber\",\n       \"LINENUMBER\" as \"ImplLineNumber\",\n    \
  \   \"DV_U_IMPLEMENTATION_TYPE\" as \"ImplImplementationType\",\n       \"U_GO_LIVE_DATE\"\
  \ as \"ImplGoLiveDate\",\n       \"ACCOUNT\" as \"ImplAcctSysID\",\n       \"ACTIVE\"\
  \ as \"ImplActive\",\n       \"DV_U_BUSINESS_UNIT\" as \"ImplBusinessUnit\",\n \
  \      \"CONTRACT_NUMBER\" as \"ImplContractNumber\",\n       \"CONTRACT_LINE\"\
  \ as \"ImplContractLine\",\n       \"SYS_CREATED_ON\" as \"ImplSysCreatedOn\",\n\
  \       \"U_PRODUCT_DESCRIPTION\" as \"ImplProductPriceSysID\",\n       \"DV_U_PRODUCT_DESCRIPTION\"\
  \ as \"ImplProductPrice\",\n       \"DV_IMPLEMENTATION_STAGE\" as \"ImplStage\"\
  ,\n       \"SYS_UPDATED_ON\" as \"ImplSysUpdatedOn\"\nFROM \"RDS\".\"SURF\".\"X_SNC_IMPLMNTATION_IMPLEMENTATION\"\
  ;"
